    [],nt"revision_timestamp": "2016-07-27T23:04:46.767073",nt"name": "2005-land-cover-and-land-use-spatial-database-of-fox-river-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "The U.S. Geological Survey (USGS) - Upper
    Midwest Environmental Sciences Center (UMESC) has produced a high-resolution land
    cover/land use (LCU) spatial database of Fox River National Wildlife Refuge (FRNWR).
    The LCU data were interpreted from September 21, 2005 color-infrared (CIR) aerial
    photographs (1:8,000-scale). Vegetation types were classified with refuge-derived
    classes and then linked to the National Vegetation Classification System (NVCS)
    at the Formation level, and whenever possible, the Alliance level. The photos were
    interpreted using a minimum mapping unit of 1-acre (Polygons may be smaller than
    one acre when mapping Phragmites, ditches, small islands, or a significant feature)
    and a 10% minimum vegetation cover. The photos were interpreted to delineate land
    cover/land use, percent vegetation cover, and tree height. The geographic extent
    of the FRNWR LCU database encompasses 1,320 acres of wetland and upland habitat
    along the Fox River in Marquette County, Wisconsin.",nt"license_title": "License
